import React,{useState} from 'react';
import { StyleSheet, Text, View,TouchableOpacity, FlatList } from 'react-native';
import {gStyle} from '../styles/style';

export default function Main({navigation}) {
  {
    const loadScreen =()=>
    {
      navigation.navigate('Contact');
    }
    const [news,setNews] = useState (
      [
        {name: 'Goo', anons: 'Google', full: 'Google is cool!', key:'1',img: 'https://freesvg.org/img/1534129544.png'},
        {name: 'App', anons: 'Apple', full: 'Apple is cool!',key:'2',img:'data:image/png;base64,'},
        {name: 'Face', anons: 'Facebook', full: 'Facebook is cool!',key:'3',img:'https://www.facebook.com/images/fb_icon_325x325.png'},
      ]
    )
    return (
      <View style = {gStyle.main}>
            <Text style = {gStyle.title}>Главная страница </Text>
            <FlatList data={news} renderItem = {({item}) => (
              <TouchableOpacity onPress ={()=>navigation.navigate('Contact',item)}>
                <Text>{item.name}</Text>
              </TouchableOpacity>
            )}/>
      </View>
    )
  }
}

const styles = StyleSheet.create({
  main:
  {

  }
});
